import React from 'react';
import './pokedex.css';

function Pokedex() {
  return (
    <div className="pokedex-container">
      <div className="header">
        Pokedex
      </div>
      <div className="buttons-container">
        <button className="pokemon-button">Pikachu</button>
        <button className="pokemon-button">Charizard</button>
        <button className="pokemon-button">Geodude</button>
        <button className="pokemon-button">Rattata</button>
      </div>
      <div className="select-text">
        Select a Pokemon!
      </div>
    </div>
  );
}

export default Pokedex;
